import Sign_up from "./component/Sign_up";
import "./App.css";
import { Route, Routes, BrowserRouter } from "react-router-dom";
// import Merchant_login from "./component/Merchant_login";

function App() {
  return (
    <div className="App">
      <Sign_up />

      <Routes>
        <Route path="/" element={<Sign_up />} />
        <Route path="/Merchant_login" element={<Merchant_login />} />
      </Routes>
    </div>
  );
}

export default App;
